import React from 'react'
import { Link } from 'react-router-dom'
import './Navbar.css'

const logo = ""

function Navbar() {
    return (
        <div className="navbar">
            <img src={logo} alt="logo" />
            <Link to="/"></Link>
        </div>
    )
}

export default Navbar
